.select-price {
  display: flex;
  margin-top: 12px;
  .b-1-cl {
    color: #828ea1;
  }
  .form-control {
    height: 40px;
    line-height 38px;
    border-radius: 2px;
    border-width: 1px;
    border-style: solid;
    font-size: 14px;
    position: relative;
    box-sizing: border-box;
    // display: flex;
    &.a-3-bd {
      border-color: #828ea1;
    }
    input {
      padding: 0px 8px;
      width: 220px;
      height: 100%;
      font-size: 14px;
      float: right;
      text-align: right;
    }
    .percentage-vol {
      padding: 0px 8px;
      width: 220px;
      height: 100%;
      font-size: 14px;
      float: right;
      text-align: right;
    }

    input::-webkit-input-placeholder,
    input:-moz-placeholder,
    input::-moz-placeholder, input:-ms-input-placeholder {
      font-size: 14px;
    }

    .unit {
      float: right;
      padding-right:8px;
    }
    span {
      color: #828ea1;
    }
    span.title {
      position: absolute;
      left: 8px;
    }
  }
  .market-price {
    width: 210px;
    height: 40px;
    line-height: 40px;
    border-radius: 2px;
    border-width: 1px;
    border-style: solid;
    font-size: 14px;
    padding: 0px 8px;
    cursor: not-allowed;
    box-sizing: border-box;
  }


  .market-price-btn {
    display: block;
    width: 68px;
    height: 38px;
    line-height: 40px;
    margin-left: 10px;
    border-radius: 2px;
    border-width: 1px;
    border-style: solid;
    text-align: center;
    user-select: none;
    border-color: #828ea1;
  }
  .tip-text2 {
    display: none;
    width: 200px;
    padding: 20px;
    position: absolute;
    left: 0px;
    top: 18px;
    z-index: 10;
    box-shadow: 0px 0px 5px rgba(0,0,0,0.2);
    line-height: 1.5;
    border-width: 1px;
    border-style: solid;
  }
  .promptText {
    border-bottom-style: dashed;
    border-bottom-width: 1px;
    position: relative;
    line-height: 18px;
    cursor: pointer;
    top: 10px;
    &:hover {
      .tip-text2 {
        display: block;
      }
    }
  }
}
